-- Drop existing tables if they exist
IF OBJECT_ID('district', 'U') IS NOT NULL DROP TABLE [district];
IF OBJECT_ID('amphur', 'U') IS NOT NULL DROP TABLE [amphur];
IF OBJECT_ID('province', 'U') IS NOT NULL DROP TABLE [province];
IF OBJECT_ID('geography', 'U') IS NOT NULL DROP TABLE [geography];
GO

-- Set database collation
ALTER DATABASE ... COLLATE Thai_CI_AS;
GO

-- Create tables with Thai collation
CREATE TABLE [geography] (
  [GEO_ID] INT IDENTITY(1,1) NOT NULL,
  [GEO_NAME] NVARCHAR(150) COLLATE Thai_CI_AS NOT NULL,
  PRIMARY KEY ([GEO_ID])
);
GO

CREATE TABLE [province] (
  [PROVINCE_ID] INT IDENTITY(1,1) NOT NULL,
  [PROVINCE_CODE] VARCHAR(2) NOT NULL,
  [PROVINCE_NAME] NVARCHAR(150) COLLATE Thai_CI_AS NOT NULL,
  [GEO_ID] INT NOT NULL default '0',
  PRIMARY KEY ([PROVINCE_ID])
);
GO

CREATE TABLE [amphur] (
  [AMPHUR_ID] INT IDENTITY(1,1) NOT NULL,
  [AMPHUR_CODE] VARCHAR(4) NOT NULL,
  [AMPHUR_NAME] NVARCHAR(150) COLLATE Thai_CI_AS NOT NULL,
  [POSTCODE] VARCHAR(5) NOT NULL,
  [GEO_ID] INT NOT NULL default '0',
  [PROVINCE_ID] INT NOT NULL default '0',
  PRIMARY KEY ([AMPHUR_ID])
);
GO

CREATE TABLE [district] (
  [DISTRICT_ID] INT IDENTITY(1,1) NOT NULL,
  [DISTRICT_CODE] VARCHAR(6) NOT NULL,
  [DISTRICT_NAME] NVARCHAR(150) COLLATE Thai_CI_AS NOT NULL,
  [AMPHUR_ID] INT NOT NULL default '0',
  [PROVINCE_ID] INT NOT NULL default '0',
  [GEO_ID] INT NOT NULL default '0',
  PRIMARY KEY ([DISTRICT_ID])
);
GO

